INSERT INTO `tb_warncode` VALUES ('66', 'W2-33', '未检测到血液循环', '●在治疗中，未检测到血液时发生。', '① 按停止键。\r\n② 按解除键。\r\n③ 确认有血液循环，按开始键。', '1');
INSERT INTO `tb_warncode` VALUES ('67', 'W3-01', '装备风扇停止', '●装置背面上部的风扇停止时发生。', '① 处理后按解除键。\r\n② 如再发生，对装置进行检修。', '4');
INSERT INTO `tb_warncode` VALUES ('68', 'W3-02', '过浓缩', '●（滤过泵流量—透析液泵流量）与血液泵流量的比率超过过浓缩报警设定值时发生。', '① 确认流量设定。\r\n② 确认过浓缩报警的设定值。', '4');
INSERT INTO `tb_warncode` VALUES ('69', 'W3-03', '预冲不足', '●在自动预冲结束时，监测重量计（WS2）的变化量未达到设定的清洗量时发生。', '① 确认预冲确实实施。\r\n② 预冲实施时按解除键。\r\n③ 预冲未实施时，更换膜件和管路，进行预冲。', '4');
INSERT INTO `tb_warncode` VALUES ('70', 'W3-04', '电量不足警报', '●在蓄电池电量低于10%发生', '① 接通外部电源,按解除键。\r\n② 如再发生这种情况，请检修蓄电池和电源。', '4');
INSERT INTO `tb_warncode` VALUES ('71', 'W3-05', '电源风扇停止', '●', '① 有可能是装置的故障。\r\n② 有可能是装置附近有强噪声源。\r\n③ 将装置的电源OFF 10 秒以后，再次ON。\r\n④ 如再发生这种情况，终止使用。', '1');
