INSERT INTO `tb_warncode` VALUES ('73', 'W3-07', '重量计(WS4)过负荷', '●监测重量计（WS4）所加的重量超过5.5kg 时发生。（向下负荷）', '① 清除重量计上的负荷。\r\n② 按解除键。\r\n③ 如再发生，则要对装置进行检修。', '1');
