INSERT INTO `tb_warncode` VALUES ('75', 'W3-09', '通信异常3', '●', '①\r\n②\r\n③\r\n④', '1');
INSERT INTO `tb_warncode` VALUES ('76', 'W3-10', 'CPU系统停机', '●', '① 有可能是装置的故障。\r\n② 有可能是装置附近有强噪声源。\r\n③ 将装置的电源OFF 10 秒以后，再次ON。\r\n④ 如再发生这种情况，终止使用。', '1');
